import { useState, useEffect } from 'react';

function GetData() {
  const userInfo = {
    name: ""
  }

  useEffect(() => {
    fetch("/", {
      method: "POST",
      headers: {
        'Content-type': "aplication/json"
      },
      body: JSON.stringify(userInfo)
    })
    .then(res => res.json()
    .then(data => console.log(data)))
  }, [])
}



